        ?>
        <h1>Qu'est-ce que l'aquaponie ?</h1>
        <p><b>L'aquaponie est une forme d'agriculture écologiquement intensive qui combine l'aquaculture</b>, l'élevage de poissons ou d'autres d'espèces aquatiques, <b>et l'hydroponie</b>, la culture de végétaux hors-sol.</p>

          <div class="row schematic-explanations">
            <div class="column schematic-text-container">
              <p>Inspirée de pratiques ancestrales, l'aquaponie vise à reproduire des processus et des intéractions biologiques observables dans un écosystème naturel.</p>
              <p>Il s’agit d’un <b>système fermé</b> dans lequel cohabitent : </p>
              <p><span class="top-separator">les poissons</span><br> dont les déjections riches en éléments organiques font office de source de nutriments pour les plantes.</p>
              <p><span class="top-separator">les bactéries</span><br> qui ont un rôle d’intermédiaire en convertissant les effluents des poissons en nutriments assimilables par les
                plantes.</p>
              <p><span class="top-separator">les plantes</span><br> qui ont une fonction de filtration en améliorant en retour la qualité de l'eau pour les poissons.</p>
            </div>
            <div class="column">
              <img src="data:image/png;base64," alt="Schéma expliquant le fonctionnement de l'aquaponie">
            </div>
          </div>
          <p>On obtient ainsi une double production de plantes et de poissons.</p>
          <p>Avec de bonnes pratiques, <b>les autres atouts de l'aquaponie sont multiples</b> : <br>
            <ul>
              <li>très faible utilisation d'eau et de fertilisants ;</li>
              <li>absence totale de rejets dans l'environnement ;</li>
              <li>aucun pesticide ni antibiotique ;</li>
              <li>excellent rendement et goût des produits ;</li>
              <li>travail à hauteur et pas de désherbage ;</li>
              <li>outil pédagogique et vecteur de lien.</li>
            </ul>
          </p>
          <p>Enfin, il est possible d'<b>élever et de cultiver tous types de poissons d'eau douce et de plantes</b> !</p>
      </div>
    </section>
    <section id="nos-prestations" class="container">
      <div class="content-wrapper introduction-prestations-wrapper">
        <div class="content">
          <h1>Nos prestations</h1>
          <p>Nous fabriquons des <b>installations sur-mesure</b>, allant du système <b>domestique</b> à la ferme <b>commerciale</b>.<br>
          Nous proposons également une <b>gamme de modèles standards clés en main</b>.</p>
          <p>Au delà de la fabrication artisanale dans notre atelier, nous réalisons chacune des étapes du processus d'installation de systèmes aquaponiques : étude préliminaire et conception, construction et montage sur place, entretien des réalisations et formation.</p>
          <p>Faisant partie de l'Économie Sociale et Solidaire, nous nous adressons à tous types de publics portant des valeurs écologiques et sociales : <b>particuliers, entreprises et associations, collectivités, agriculteurs installés ou en devenir</b>.</p>
