      <div class="content-wrapper prebuild-products-wrapper">
        <div class="content">
        <img data-src="assets/img/Vegeto_illustration_300x220px-small.png" alt="Séparateur graphique représentant des plantes." class="graphic-separator lazy-load">
        <p><b>Systèmes clés en main :</b></p>
        <p>Nos systèmes sont fabriqués et assemblés dans notre atelier. Les installations sont livrées et installées par nos soins. Nous fournissons l'ensemble des consommables requis en aquaponie (poissons, semences, plants, nourriture pour poissons, tests physico-chimiques...).</p>
        <p>Nous vous proposons également des ensembles aquaponiques complets en partenariat avec les serres <b>Hélio</b>. L'aménagement intérieur est alors modulable sur-mesure.</p>
        <div class="prebuild-products">
          <div class="row">
            <div class="column">
              <div class="product">
                <img class="lazy-load" data-src="assets/img/Vegeto_640x640px_Primeur-small.jpg" alt="Photo de notre système Primeur">
                <p><span class="top-separator">Primeur</span><br>
                  Ce système aquaponique au fonctionnement simple et à l'entretien minime en fait une installation parfaite pour les débutants. Il permet de cultiver divers types de plantes sur un mètre carré tout en élevant des poissons dans un volume de 600 litres. La surface de culture peut être doublée avec l'ajout en option d'un bac de culture en sub-irrigation.</p>
              </div>
            </div>
            <div class="column">
              <div class="product">
                <img class="lazy-load" data-src="assets/img/Vegeto_640x640px_Herbarium-small.jpg" alt="Photo de notre système Herbarium">
                <p><span class="top-separator">Herbarium</span><br>
                  Cette installation sous la forme de mobilier intérieur est destinée à la culture d'herbes aromatiques et de petites plantes pour son domicile, un hall d'accueil, un restaurant ou un bar. Avec sa faible surface, vous pourrez produire des végétaux toute l'année tout en profitant du plaisir d'un aquarium.</p>
              </div>
            </div>
            <div class="column">
              <div class="product">
                <img class="lazy-load" data-src="assets/img/Vegeto_640x640px_GardeManger-small.jpg" alt="Photo de notre système Garde-manger">
                <p><span class="top-separator">Garde-manger</span><br>
                  Cette installation est parfaitement adaptée à la production autonome d'aliments pour une famille ou une petite communauté. Avec l'utilisation de radeaux flottants, vous pourrez cultiver une très large gamme de végétaux sur quatre mètres carrés en vous offrant régulièrement un repas de vos poissons. Ce système est modulable pouvant être agrandi ou dupliqué sur demande.</p>
                </div>
            </div>
          </div>
          <div class="row">
            <div class="column">
              <div class="product">
                <img class="lazy-load" data-src="assets/img/Vegeto_640x640px_Oasis-small.jpg" alt="Photo de notre système Oasis">
                <p><span class="top-separator">Oasis</span><br>
                  C'est notre modèle référence en matière de culture verticale. Disposant d'assises et d'une pergola végétalisée, il permet de faire pousser jusqu'à 160 plants sur des tours verticales. Son aspect esthétique s'intègre parfaitement en extérieur dans des parcs, jardins ou cours comme en intérieur avec un éclairage LED.</p>
              </div>
            </div>
            <div class="column">
              <div class="product">
                <img class="lazy-load" data-src="assets/img/Vegeto_350x350px_Helio-small.jpg" alt="Photo de notre partenaires Helio représentant la serre Sereno">
                <p><span class="top-separator">Sereno</span><br>
                  Composée de bois et de feuilles de polycarbonate transparentes entièrement recyclables, cette gamme de serre épurée est fabriquée en baie de Somme par des artisans spécialistes en ouvrage bois depuis 1923. Une serre aquaponique Hélio de 20 m² représente par exemple 5 m² de culture et 1200 L de bassins. Surfaces disponibles de 6 à 40 m².</p>
                <p><i>Plus d'informations: <b><a href="https://www.serreenbois.com/" rel="nofollow, noopener" target="_blank" title="Accéder au site d'Helio">www.helio.fr</a></b></i><p>
              </div>
            </div>
          </div>
        </div>
